using System;
using System.Collections.Generic;
using System.Text;

namespace Day_27
{
    class RemoveAllAdjacentsFromString
    {
        public static string RemoveDuplicates(string s, int k)
        {
            int counter = 0;
            for (int i = 0; i < s.Length; i++)
            {
                char first_char = s[i];
                if (i + k <= s.Length)
                {
                    bool check = true;
                    foreach (char c in s.Substring(i, k))
                    {
                        if (c != first_char)
                        {
                            check = false;
                            break;
                        }
                    }
                    if (check == true)
                    {
                        s = s.Remove(i, k);
                        counter++;
                    }
                }
            }
            if (counter > 0)
            {
                s = RemoveDuplicates(s, k);
            }
            return s;
        }

